// Model runs for analysis of analytical model's approximations

Analysis <Focus, Type, UnitCost, NMax, U_A, N, Seed, NBMax>
generations          = 0
epsilon              = 1e-12 // When to consider the wild-type transposon at equilibrium
gamete_threshold     = 0
transition_threshold = 0
marginal_threshold   = 0
analysis_gens0     = -1
analysis_gens      = 200
analysis_seed      = <Seed>
analysis_nb_max    = <NBMax>
analysis_special_gen = 100
analysis_special_prob  = 0.0001
analysis_special_focus = <Focus>
n_max              = <NMax>
mode               = analysis2
type               = <Type>
n_0                = 0.1
w                  = n,u -> (1 - <UnitCost>) ^ (0.5*<N>*<N>) 
u                  = <U_A>
u_B                = <U_A>
v                  = 0.000 // NOTE THIS IS SET TO ZERO
invasion_seed      = 0.001
fileout            = ./Runs/5-Analysis-Partial/<$Name>.ngd
report_freq        = 1000

